import React, {Component} from 'react';
import {TextField} from '@material-ui/core'

class NumberField extends Component{

    render(){ 
        return (
        <TextField
                    floatingLabelText="NumberInput"
                    value={0}
                    onChange={this.props.handleChange}
                    errorText={"ERROR"}
                    strategy="warn"
                    type="number"
                    min={0}
                    max={1}
                    required
                />
        )
    }
}

export default NumberField;
